from collections import defaultdict
import heapq

def dijkstra(graph, start, end):
    pq = [(0, start, [])]
    visited = set()
    while pq:
        (cost, node, path) = heapq.heappop(pq)
        if node in visited:
            path = path + [node]
            if node == end:
                return (path, cost)
            visited.add(node)
            for (neighbor, weight) in graph[node]:
                if neighbor not in visited:
                    heapq.heappush(pq, (cost + weight, neighbor, path))
    return ([], float('inf'))

